const impchart = Vue.component('imp-chart', {
  props: ['title', 'chartid', 'chart-data'],
  template: `
  <div class="card">
    <div class="card-body">
      <h5 class="card-title">{{ title }}</h5>
      <div :id="chartid" class="chart" chart-data="chart-data"></div>
    </div>
  </div>`,
  data() {
    return {
      chart: undefined
    }
  },
  mounted() {
    let chartid = this.chartid
    this.chart = Highcharts.chart(chartid, {
      chart: {
        zoomType: 'x'
      },
      title: {
        text: ''
      },
      yAxis: {
        title: ''
      },
      tooltip: {
        valueSuffix: ' mV'
      },
      tooltip: {
        valueDecimals: 2
      },
      series: [{
        data: this.chartData,
        name: '',
        lineWidth: 0.8,
        showInLegend: false,
        turboThreshold: 500000
      }]
    })
  }
})

var app = new Vue({
  el: '#app',
  data() {
    return {
      heartRate: 0,
      rr_interval: 0,
      haveProblem: false,
      comment: '',
      loading: false,
      charts: [],
    }
  },
  components: { impchart },
  created() {
    // this.lodingCSV();
  },
  methods: {
    onFileChange() {
      let file = document.getElementById('inputCSV').files;

      if (!file.length) {
        swal({
          icon: 'error',
          title: '請載入檔案'
        });
      }
      else {
        Papa.parse(file[0], {
          header: true,
          complete: function (results) {
            results = results.data;

            let sol = results.map((item, index) => {
              return _.toNumber(item.ECG2);
            });
            console.log(sol);
          }
        });
      }
    },
    lodingCSV() {
      this.loading = true;
      let charts = [];
      this.charts = [];
      fetch('../data/demo.json')
        .then((response) => {
          return response.json()
        })
        .then((apiResp) => {
          let titles = {
            'IMF1': '1st IMF',
            'IMF2': '2nd IMF',
            'IMF3': '3rd IMF',
            'IMF4': '4th IMF',
            'IMF5': '5th IMF',
            'IMF6': '6th IMF',
            'IMF7': '7th IMF',
            'IMF8': '8th IMF',
            'IMF9': '9th IMF'
          };

          _.forEach(apiResp, (data, key) => {
            if (key === 'heartRate') {
              this.heartRate = data;
            }
            else if (key === 'rr_interval') {
              this.rr_interval = 0;
            }
            else if (data.length !== 0) {
              data = JSON.parse(data);

              charts.push({
                chartid: key,
                title: titles[key],
                data: data
              });
            }
          })

          this.charts = _.sortBy(charts, ['title']);
          this.loading = false;
        })
    }
  }
})
